const Form = (props) => {
  return (
    <form>
      <label>Name</label>
      <input type="text" name="Name"></input>
      <br></br>
      <label>Category</label>
      <input type="text" name="Category"></input>
      <br></br>
      <button onClick={props.onSearch}>Search</button>
    </form>
  );
};
export default Form;
